import React from 'react';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';

function Bouton({ onIncrement }) {
  return (
    <Box 
    display="flex" 
    justifyContent="center" 
    alignItems="center" 
    minHeight="100vh" 
  >
    <Button 
      variant="contained" 
      color="primary" 
      onClick={onIncrement}
    >
      Incr√©menter
    </Button>
    </Box>
  );
}

export default Bouton;
